import { useEffect, useState } from 'react';
import { webHeader } from '../utils/data';
import '../styles/Components/navbar.css';
import { useNavigate } from 'react-router-dom';
import { faCaretDown } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Id } from '../App';
import axios from 'axios';


export function Navbar1(props: { navItems: { Icon: JSX.Element, title: string, url: string }[] }) {
    return (
        <div className="Navbar1">
            <div className="allItems1">
                <ul className="pagesItemsUl1">
                    {props.navItems.map((curr, i) => (
                        <li key={i}> <a href={curr.url}> {curr.Icon}  {curr.title} </a></li>
                    ))}
                </ul>
            </div>
        </div>





    );
}



export function Navbar2(props: { navItems: { title: string, url: string }[] }) {

    useEffect(() => {
        (document.querySelector('.headerOfWeb') as HTMLElement).innerHTML = webHeader.innerHTML
    }, []);







    return (
        <div className="Navbar2">
            <div className="allItems2">
                <div className='headerOfWeb'>
                    <h1> speak your heart out </h1>
                </div>

                <ul className="pagesItemsUl2">
                    {props.navItems.map((curr, i) => (
                        <li key={i}> <a href={curr.url}>{curr.title}
                        </a> </li>
                    ))}

                </ul>


            </div>

        </div >

    )

}


export function AskNav(props: { navItems: { title: string, url: string, options: { title: string, url: string }[] }[] }) {
    const navigate = useNavigate();
    const [isOpen, setisOpen] = useState(false);
    const [Key, setKey] = useState(0);

    return (
        <div className="askNavDiv">
            <div className="allItems">

                <ul className="Ulnames">
                    {props.navItems.map((curr1, i) => (

                        < li onClick={() => { setisOpen(!isOpen) }} id='myLi' > {curr1.title} <FontAwesomeIcon icon={faCaretDown}></FontAwesomeIcon>
                            {isOpen && Key &&
                                < ul className='optionUl'>
                                    {curr1.options.map((curr2, z) => (
                                        <li key={z}>
                                            <div className='url' data-url={'/Ask/' + curr2.url}
                                                onClick={() => { navigate('/Ask/' + curr2.url) }} >
                                                {curr2.title}
                                            </div>
                                        </li>
                                    ))}
                                </ul>
                            }
                        </li>
                    ))}

                </ul>
            </div>

        </div >
    )
}

export function AskIcons(props: { navItems: { Icon: JSX.Element, url: string, options: { title: string, url: string }[] }[] }) {
    const navigate = useNavigate();
    const [isOpen, setisOpen] = useState(false);
    let url = 'http://127.0.0.1:5789/people/';

    useEffect(() => {
        axios.get(url)
            .then(response => {

                console.log(response.data);
            });
    }, []);

    const deleteUser = () => {
        url = url + Id.id;
        axios.delete(url)
            .then(response => {
                console.log(response.data);
            });

        navigate('/Home');
    }
    const updateUser = () => {

        axios.put(url)
            .then(response => {
                console.log(response.data);
            });
    }

    return (

        <div className="divAroundAll">
            <ul className='IconsUl'>
                {props.navItems.map((curr1, i) => (
                    <li onClick={() => { setisOpen(isOpen ? false : true) }} key={i}> <div className='divAroundIcons'> {curr1.Icon} </div>
                        <div> {isOpen &&
                            <ul className='optionUl' >
                                {curr1.options.map((curr2, z) => (
                                    <li id='links' key={z}>
                                        <div className='url' data-url={'/Ask/' + curr2.url}
                                            onClick={() => { navigate('/Ask/' + curr2.url) }} >
                                            {curr2.title}
                                        </div>
                                    </li>
                                ))}

                                <li onClick={() => { deleteUser() }}> delete </li>
                                <li onClick={() => { updateUser() }}> update </li>
                                <li> sign out</li>
                            </ul>
                        }

                        </div>

                    </li>
                ))}

            </ul>

        </div >
    )
}
